◎乾燥の気になる部分に！

<br>●乾燥の気になる部分に！
お肌をやさしく守り、うるおいを逃さない保湿クリームです。やわらかくなめらかで、すこやかな肌へ。唇、顔、手、足などお肌全体にお使い頂けます。防腐剤無添加、無着色、無香料。<br><br>【内容量】200g
<br>【成分】ワセリン、酢酸トコフェロール、BHT 
<br>【原産国】インド
<br>【使用上の注意】傷、湿疹等、肌に異常がある時には使用しない。肌に異常があらわれた時は使用を中止し、皮ふ科医等へ相談する。目に入ったときは、すぐに洗い流す。直射日光のあたる場所、高温の場所に置かない。横やさかさまにして保管しない。液がにじみ出る恐れがある。子供の手に届くところに置かない。<br><br>広告文責：東洋通信システム082-298-9555<style type="text/css">
