◆特徴◆<br>疲れが気になるお肌に、コクのある上質なうるおいを<br>与える薬用保湿クリームです。<br><br>
岩石抽出物や、レシチン、ヨクイニンエキス、<br>グリチルレチン酸ステアリル、スクワランなどを配合。<br><br>
お肌を保護し、うるおいをキープ。<br><br>
水溶性のライトクリームなので、しっとりなのに<br>サラサラに保ちます。<br>
乾燥肌から普通肌の方に。<br><br>【医薬部外品】<br><br>◆ご使用方法◆洗顔後、化粧水で整えた肌にお使いください。<br>
パール粒大1～2個の量を清潔な指にとり、両ほほ、<br>あご、鼻、ひたいにおいて軽くのばし、おさえるようによくなじませます。<br>
メイク下地としてお使いのときは、クリームが肌に<br>十分になじんでから、ファンデーションをつけてください。 <br><br>◆成分◆<br>セタノール、トリエタノールアミン、パラベン、香料<style type="text/css">
