孜民耕(ジャミンキョン)<br>
Crema Caracol(カラコールかたつむりクリーム)<br>
内容量:60ml×2点<br>
<br>
カタツムリの特性に着目した、お肌への栄養クリーム！<br>
 高級美容成分/カタツムリ成分90%配合！<br>
E・G・F、アルブチン、アデノシン配合！<br>
<br>
たっぷり濃厚な高級美肌エキスで、エイジングケアが出来ます。<br>
お肌のサイクルを美肌サイクルへとサポートし、潤い溢れるぷるぷる美肌へと導きます。<br>
 毛穴の開き・乾燥肌・オイリー肌に、優しくアプローチしてくれます。<br>
<br>
【使用方法】<br>
◆カタツムリローション(化粧水) → カタツムリクリーム(乳液)の順番でお使い下さい。<br>
<br>
高級美容成分【カタツムリ成分90%】配合<br>
E・G・F、アルブチン、アデノシン配合<br>
【成分】<br>
カタツムリ分泌液・水・グリセリン・マカデミアナッツ油・シロキクラゲエキス・プラセンタエキス・ ヒトオリゴペプチドー１・キャビアエキス・カルボマー・ＴＥＡ・オレスー５・ステアリン酸グリセリル・ラノリン・オレスー10・ミネラルオイル・ポリアクリルアミド・イソパラフィン・ラウレスー７・ポリア クリル酸Ｎａ・ノノキシノールー12・ＥＤＴＡ－2Ｎａ・メチルパラベン・香料<br>
<br>
韓国製<br>
JAN:4580268265305<br>
メーカー：ジャミンキョン<br>
商品区分：化粧品<br>
広告文責：蓮興商事株式会社  <br>
