ピュアヴァージン ナチュラル スクワランオイル100<br>
<br>
●商品特徴<br>
お肌にやさしく、オイルとは思えないサラリと感触のスクワラン オイル(スキンケア)です。<br>
お肌になじみ、ベタつかずにうるおいを保ちます。<br>
天然スクワランオイル100%の高純度オイル。<br>
スクワランはもともとお肌に存在する大切なうるおい成分。<br>
スキンケア、ボディケア、ヘアケアにご使用いただけます。<br>
<br>
<br>
●使用方法 <br>
適量を手にとり、お肌によくなじませてください。<br>
・スキンケアとして<br>
洗顔後、水滴にのついたままパッティングするようになじませてください。<br>
・ボディケアとして<br>
 お風呂あがりに少量のスクワラナンオイルを加えたお湯を全身に浴びます。マッサージオイルとしてもお使い頂けます。<br>
・ヘアケアとして<br>
 シャンプーの後に、スクワランオイルを加え、リンスのようにご使用ください。<br>
<br>
●使用上の注意<br>
・お肌に傷、はれもの、湿疹等異常のある時はお使いにならないでください。<br>
・使用中に赤み・はれ・かゆみ・刺激等の異常が現れた場合にはご使用を中止し、皮膚科専門医等へのご相談をおすすめいたします。<br>
・目に入った時はすぐに洗い流してください。<br>
・高温多湿や低温の場所、直射日光の当たる場所には保管しないでください。<br>
